0, 'number', 'r', '%12+ anos escol', NULL), (39, 'var039', 'Prop_CD4', 'Perfil da epidemia', 4, 'Percentual de casos de aids em adultos diagnosticados pelo critério CD4 (2002-2005) ', 'Programa Estadual DST/Aids - SES/SP; Fundação Seade. BIPAids.', 'Número de  casos notificados de aids com critério de definição CD4 dividido pelo total de casos notificados de aids notificados entre 2002 e 2005, multiplicado por 100', 'Ao se notificar casos pelo critério CD4, o paciente não apresenta sintomas da doença, portanto significa que teve acesso ao serviço de saúde mais precoce e possibilitando receber maiores  cuidados, melhor atenção de forma mais integral.É um dos indicadores utilizados para avaliar a  vulnerabilidade programática. Expressa as condições de diagnóstico e a qualidade da assistência médica dispensada, bem como o efeito das ações educativas e adoção de medidas de prevenção.', '  ', 100, 'number', 'r', '% critério CD4', NULL), (40, 'var040', 'Prop_Obt_Precoce_Obt', 'Programático ', 3, 'Percentual de óbitos precoces no total de óbitos por aids (2002-2005)', 'Programa Estadual DST/Aids - SES/SP; Fundação Seade. BIPAids.', 'Número de  óbitos por aids com menos de 1 ano de diferença entre as datas de óbito e diagnóstico, dividido pelo total de óbitos por aids entre 2002 e 2005, multiplicado 100.', 'A mortalidade ocorrida no primeiro ano após o diagnóstico está relacionada com o diagnóstico tardio e à deficiência na qualidade dos serviços prestados.', 'Sub-registro de óbitos e deficiência no registro sobre data de diagnóstico.', 100, 'number', 'r', '% óbitos prec', NULL), (41, 'var041', 'Prop_CritObt_0205', 'Programático ', 3, 'Percentual de casos de aids em adultos segundo critério óbito (2002-2005)', 'Programa Estadual DST/Aids - SES/SP; Fundação Seade. BIPAids.', 'Número de  casos notificados de aids por Critério Óbito dividido pelo total de casos notificados entre 2002 e 2005 multiplicado por 100', 'O critério óbito é utilizado quando na investigação de óbito por aids não há informações para classificá-lo nos outros critérios de definição de caso. Quanto menor o percentual melhor a qualidade dos serviços, tanto da assistência quanto da vigilância epidemiológica, pois o número elevado de casos de aids conhecidos por meio da notificação do óbito, pode também indicar diagnóstico e tratamento tardio. ', 'Preenchimento inadequado da causa de morte na declaração de óbito.', 100, 'number', 'r', '% crit óbito', NULL), (42, 'var042', 'Prop_Resid_Notif', 'Programático ', 3, 'Razão de casos de aids em adultos de residentes em relação ao total de notificados (2002-2005)', 'Programa Estadual DST/Aids - SES/SP; Fundação Seade. BIPAids.', 'Número de  casos notificados de residentes dividido pelo total de  casos notificados entre 2002 e 2005 multiplicado por 100', 'Razões acima de 100% indicam que o município notifica casos de não residentes (invasão). Razões abaixo de 100% indicam que residentes foram notificados por serviços de outros municípios (evasão).', 'Mal preenchimento do endereço de residência na fiha de notificação.', 100, 'number', 'r', 'residentes/total ', NULL), (43, 'var043', 'Razão_Cri_Fem15a49', 'Programático ', 3, 'Razão entre casos de aids em menores de 13 anos e de mulheres de 15 a 49 anos na população, por 100 (2002-2005)', 'Programa Estadual DST/Aids - SES/SP; Fundação Seade. BIPAids.', 'Número de  casos notificados de aids de menores de 13 anos dividido pelo total de  casos notificados de mulheres de 15 a 49 anos entre 2002 e 2005 multiplicado por 100', 'Indica a ocorrência ou não de casos de transmissão vertical em mulheres sexualmente ativas e portadoras do HIV. Menores valores indicam menor incidência de gestantes HIV positiva ou bom funcionamento dos serviços  em relação a assistência a gestante e ao recém-nascido no pré-natal e parto.', 'Há subnotificação de casos e/ou atraso no recebimento das notificações de aids.', 100, 'number', 'r', '<13 anos/M 15-49 anos', NULL), (44, 'var044', 'RazãoSexo_13a24', 'Indivíduo', 2, 'Razão de sexos dos casos de aids com idade entre 13 e 24 anos (2002-2005)', 'Programa Estadual DST/Aids - SES/SP; Fundação Seade. BIPAids.', 'Número de  casos notificados de aids de homens de 13 a 24 anos dividido pelo número de  casos notificados de mulheres na mesma faixa etária entre 2002 e 2005', 'Valores iguais a 1 indicam que o número de casos em homens e em mulheres se equivalem; acima de 1, há predominância de homens e, abaixo, predominância de mulheres.', '  ', 100, 'number', 'r', 'Razão sexos 13-24 anos', NULL), (45, 'var045', 'RazãoSexo_0205', 'Indivíduo', 2, 'Razão de sexos dos casos de aids com 13 anos ou mais (2002-2005)', 'Programa Estadual DST/Aids - SES/SP; Fundação Seade. BIPAids.', 'Número de  casos notificados de aids de homens com 13 ou mais anos dividido pelo número de casos notificados de mulheres na mesma faixa etária entre 2002 e 2005', 'Medida para refletir o equilíbrio da epidemia de aids entre os sexos. É a razão entre os casos de aids em homens e casos de aids em mulheres, que em geral se expressa como o número de casos em homens para cada mulher. Indicador que relaciona a freqüência de casos em homens em relação às mulheres, permitindo verificar a ocorrência ou não da feminilização e heterossexualização da epidemia.', '  ', 100, 'number', 'r', 'Razão sexos 13+ anos', NULL), (46, 'var046', 'Proc_DST ', 'Programático  ', 3, 'Taxa de Procedimentos de DST/aids realizados na Atenção Básica, por 10.000 hab. (2002-2005)', 'Ministério da Saúde. Sistema de Informação da Atenção Básica (SIAB).', 'Média de procedimentos médicos e de enfermagem para DST e aids no âmbito da atenção básica, considerando os programas de ACS e SF, entre 2002 e 2005 dividido pela média da população de 2003 e 2004, multiplicado por 10.000', 'Quanto maior o valor maior a incorporação das atividades de controle e prevenção da aids na atenção básica. ', 'A cobertura do sistema não é homogênea segundo os municípios, podendo haver, também, sub-registros desses procedimentos. ', 100, 'number', 'r', 'Proced DST/aids AB', NULL), (47, 'var047', 'Diag_Tardio', 'Programático ', 3, 'Percentual de pessoas com HIV com início tardio de seguimento clínico no SUS (2003-2005)', 'Ministério da Saúde;UNGASS', 'Número de pessoas que iniciaram o seguimento clínico  com contagem de células T-CD4+ menor ou igual a 200 células/mm3 e/ou com doenças e sinais associados à aids e/ou que evoluíram para óbito nos primeiros 20 dias de seguimento dividido pelo total de pess', 'O diagnóstico e o início de tratamento precoce indicam a resolubilidade do Programa em promover o acesso aos serviços de diagnóstico e tratamento nas fases iniciais da doença, promovendo a melhora da qualidade de vida das pessoas afetadas e atividades de prevenção da transmissão do HIV.   ', 'Não inclui pacientes que fazem seguimento na rede privada não conveniada com o SUS.Embora haja uma boa cobertura, o sistema não abrange 100% dos pacientes em tratamento nos serviços de saúde do estado.', 100, 'number', 'r', '%  HIV ', NULL), (48, 'var048', 'Prop_DTIgual', 'Programático ', 3, 'Percentual de casos de aids em adultos com datas de óbito e diagnóstico idênticas (2002-2005)', 'Programa Estadual DST/Aids - SES/SP; Fundação Seade. BIPAids.', 'Óbitos com datas de óbito e diagnósticos idênticas dividido pelo total de óbitos por aids entre 2002 e 2005, multiplicado por 100. ', 'Este indicador incorpora todos os critérios de definição de caso de aids. Quanto menor o percentual melhor a qualidade dos serviços, tanto da assistência quanto da vigilância epidemiológica, pois o número elevado de casos de aids conhecidos por meio da notificação do óbito, pode também indicar diagnóstico e tratamento tardio. ', 'Subregistro de aids como causa de óbito. ', 100, 'number', 'r', '%  óbito e diagn', NULL), (49, 'var049', 'numcv2005_mean', 'Programático ', 3, 'Exames de carga viral por paciente com aids em tratamento (2005)', 'Programa Nacional DST/Aids. Sistema de Controle de Exames Laboratoriais - SISCEL', 'Soma do total de exames de carga viral de pacientes com aids em tratamento dividido pelo total de pacientes com aids em tratamento em 2005', 'Esse exame  é indicador de progressão da doença, de provável resistência a medicamentos e serve para orientar a troca de terapia, garantido qualidade da assistência e de vida de pessoas vivendo com HIV. Quanto mais próximo do protocolo do Programa  Nacional de Aids (três exames/paciente/ano), melhor a qualidade do serviço. Quanto mais distante, pode indicar problemas de adesão dos pacientes ao tratamento ou problemas na disponibilização dos exames. ', 'Não inclui pacientes que, mesmo sendo acompanhados no Programa, realizam exames na rede não vinculada ao SUS.', 100, 'number', 'r', 'carga viral ', NULL), (50, 'var050', 'numcd42005_mean', 'Programático ', 3, 'Exames CD4 por paciente com aids em tratamento (2005)', 'Programa Nacional DST/Aids. Sistema de Controle de Exames Laboratoriais - SISCEL', 'Soma do total de exames de CD4 de pacientes com aids em tratamento dividido pelo total de pacientes com aids em tratamento em 2005', 'Esse exame  é indicador de progressão da doença, de provável resistência a medicamentos e serve para orientar a troca de terapia, garantido qualidade da assistência e de vida de pessoas vivendo com HIV. Quanto mais próximo do protocolo do Programa  Nacional de Aids (três exames/paciente/ano), melhor a qualidade do serviço. Quanto mais distante, pode indicar problemas de adesão dos pacientes ao tratamento ou problemas na disponibilização dos exames. ', 'Não inclui pacientes que, mesmo sendo acompanhados no Programa, realizam exames na rede não vinculada ao SUS.', 100, 'number', 'r', ' CD4', NULL), (51, 'var051', 'CTA_Hab', 'Programático ', 3, 'Centros de Testagem e Aconselhamento por 100.000 hab. (2008)', 'Programa Estadual de DST/Aids.Cadastro de Serviços. ', 'Número de Centros de Testagem e Aconselhamento em 2008 dividido pela população multiplicado por 100.000', 'Indica a disponibilidade de Centros de Testagem e Aconselhamento para o diagnóstico de pessoas vivendo com HIV. Estudos sugerem que a realização de exames diagnósticos para o HIV, associado ao aconselhamento, influencia na adoção de práticas segura para a prevenção da doença. Quanto maior a taxa, portanto mais CTAs,  maior a possibilidade de facilitar o acesso de populações mais vulneráveis ao diagnóstico, aos preservativos e o desenvolvimento de ações de prevenção.', 'A disponibilidade de serviços pode estar subestimada, devido a desatualização do cadastro, embora no ano de 2005 tenha sido realizado um senso para cadastramento destes serviços.  O diagnóstico do HIV pode estar sendo ofertado em outros serviços e program', 100, 'number', 'r', 'CTA', NULL), (52, 'var052', 'Serv_Ambulat_Notif', 'Programático ', 3, 'Serviços Ambulatoriais para aids por caso de aids (2008)', 'Programa Estadual de DST/Aids.Cadastro de Serviços.', 'Número de Serviços Ambulatoriais para aids em 2008 dividido pelo média de casos notificados de aids entre 2002 e 2005, multiplicado por 100', 'Indica a disponibilidade de serviços ambulatoriais para o tratamento de pessoas vivendo com HIV. A existência de serviços para o tratamento permite a redução da morbi-mortalidade, do estigma relacionado à doença e o trabalho educativo para a adesão às medidas de prevenção. A redução da carga viral, decorrente de tratamento adequado, pode reduzir a transmissibilidade da doença.', 'A disponibilidade de serviços por pacientes nos municípios pode ser subestimada por desatualização do cadastro de serviços. As informações do cadastro não indicam a capacidade dos serviços, o número de pacientes em tratamento ou a organização da rede de s', 100, 'number', 'r', 'Serv Amb', NULL), (53, 'var053', 'Internações_Notif', 'Programático ', 3, 'Internações SUS por Doenças relacionadas ao HIV por caso de aids  (2002-2005)', 'SIH/DATASUS', 'Média de internações SUS por doenças relacionadas ao HIV, de 2002 a 2005, dividido pelo média de casos notificados de aids entre 2002 e 2005, multiplicado por 100', 'Maior prevalência de morbidade hospitalar em decorrência de doenças do HIV indica a qualidade da assistência na prevenção da evolução da infecção.Uma média alta pode significar maior gravidade dos casos e/ou problema no acompanhamento dos casos de aids', 'Preenchimento inadequado da morbidade hospitalar em decorrência da lógica do faturamento e da disponibilidade de leitos credenciados. ', 100, 'number', 'r', 'Intern SUS', NULL), (54, 'var054', 'Prop_Teste_HIV', 'Programático ', 3, 'Percentual de Casos de Tuberculose que realizaram teste de HIV (2002-2005)', 'Ministério da Saíude.Sistema de Informações de Agravos de Notificação - SINAN', 'Número de casos notificados de tuberculose que testaram HIV dividido pelo total de casos de tuberculose entre 2002 e 2005 multiplicado por 100', 'Quanto mais elevada a proporção, melhor. O desejável é que 100% dos casos de tuberculose sejam submetidos ao teste de HIV.', 'Diferentes taxas de subnotificação de casos de tuberculose por município e não observância dos protocolos de controle de tuberculose e aids ', 100, 'number', 'r', '% TB ', NULL), (55, 'var055', 'Valor_PAM_Hab', 'Programático  ', 3, 'Recursos destinados pelo Plano de Ações e Metas do programa de DST/Aids por 100.000 hab. (2003-2008)', 'Programa Nacional DST/Aids', 'Total de Recursos acumulados de 2003 até 2008 dividido pelo número de habitantes multiplicado por 100.000', 'Indica quantos reais por 100.000 habitantes o município recebeu no periodo', '', 100, 'number', 'r', 'PAM', NULL), (56, 'var056', 'Tx_Tuberculose', 'Social ', 5, 'Taxa de incidência de tuberculose, por 100.000 hab. (2002-2005)', 'Ministério da Saíude.Sistema de Informações de Agravos de Notificação - SINAN; Fundação Seade.', 'Média anual de casos notificados de tuberculose entre 2002 e 2005 dividido pela média da população de 2003 e 2004 multiplicado por 100.000', 'Estima o risco de ocorrência de tuberculose numa determinada população, em determinado local e período de tempo. A incidência de tuberculose pode estar relacionada a prevalência da aids e à qualidade da assistência às pessoas vivendo com HIV, devido ao diagnóstico tardio ou deficiência dos serviços de saúde na adoção dos procedimentos de profilaxia. ', 'Diferentes taxas de subnotificação de casos de tuberculose por município. ', 100, 'number', 'r', 'Incid Tb', NULL), (57, 'var057', 'Gasto_Prevencao', 'Programático', 3, 'Recursos estaduais repassados para organizações da sociedade civil para prevenção a HIV/aids por hab. (2003-2008)', 'Programa Estadual DST/Aids', 'Recursos estaduais repassados para organizações da sociedade civil para prevenção a HIV/aids, no período de 2003-2008, dividido pela população de 2008', 'Indica a existência no município de organizações da sociedade civil atuantes na área de prevenção a HIV/Aids.', '', 100, 'number', 'r', 'Rec prev', NULL), (58, 'var058', 'Gasto_Assistencia', 'Programático', 3, 'Recursos Estaduais repassados para organizações da sociedade civil para assistência a HIV/aids por hab. (2003-2008)', 'Programa Estadual DST/Aids', 'Recursos estaduais repassados para organizações da sociedade civil para assistência a pessoas vivendo com HIV/aids, no período de 2003-2008, dividido pela população de 2008', 'Indica a existência no município de organizações da sociedade civil atuantes na área de assistência a adultos e crianças vivendo com HIV/Aids', '', 100, 'number', 'r', 'Rec assist', NULL), (59, 'var059', 'Possui_Ong', 'Programático  ', 3, 'Existência no município de ONG que atua em alguma área relacionada a aids (2005)', 'Programa Nacional DST/Aids', 'Existência no município de ONG que atua em alguma área relacionada a aids, em 2005', 'Indica a existência de Organizações não Governamentais promovendo assistência, prevenção e a defesa de direitos fundamentais de pessoas vivendo com HIV e vulneráveis. A presença de organizações não governamentais pode aprimorar as políticas de saúde por meio da participação e do controle social. Permite também a realização de ações de intervenção em consonância à realidade das populações mais afetadas, assim como estimula experiências inovadoras. ', 'Não inclui ONGs que atuam sem recurso governamental', 100, 'number', 'r', 'ONG', NULL), (60, 'var060', 'Prog_ACS_PSF', 'Programático ', 3, 'Taxa de Cobertura da Atenção Básica e nos programas ACS e PSF, por 100 hab. (2002-2005)', 'Ministério da Saúde.Sistema de Informações de Atençaõ Básica - SIAB', 'Média Anual de Pessoas Cadastrados pelos programas deACS e PSF, de 2002 a 2005, dividido pela média da população de 2003 e 2004 e multiplicado por 100', 'A atenção primária á saúde prevê ações de diagnóstico, tratamento e prevenção das DST e Aids, permitindo ampliar o acesso aos serviços de saúde e ações de controle da epidemia ', 'A atenção primária no Estado de São Paulo abrange outras unidades além da cobertura dos programas ACS e SF e portanto não representa a realização de ações de prevenção e controle das DST e aids neste nivel do sistema de saúde. Ela deve ser analisada em co', 100, 'number', 'r', 'Cob AB', NULL), (61, 'var061', 'Tx_DIP', 'Programático ', 3, 'Taxa de Internações SUS por doenças inflamatórias pélvica (DIP), por 100.000 hab. (2002-2005)', 'Ministério da Saúde.Sistema de Informações Hospitalares - SIH/SUS', 'Média anual de internações SUS de 2002 a 2005 dividido pela média da população de 2003 e 2004 multiplicado por 100.000', 'Quanto maior a prevalência de morbidade hospitalar em decorrência das DST, maior risco de infecção pelo HIV e o comportamento sexual desprotegido.  ', 'A fonte de informação refere-se às internações apresentadas para pagamento pelo gestor e pode não representar a totalidade dos eventos ocorridos. ', 100, 'number', 'r', 'Inter DIP', NULL), (62, 'var062', 'Tx_Internações_Droga', 'Indivíduo', 2, 'Taxa de internação SUS por transtornos mentais e comportamentais devido ao uso de outras drogas psicoativas (excetuando álcool), por 100.000 hab. (2002-2005)', 'Ministério da Saúde.Sistema de Informações Hospitalares - SIH/SUS', 'Taxa de internação SUS por transtornos mentais e comportamentais devido ao uso de outras drogas psicoativas (excetuando álcool) em 2005 dividido pela população de 2005 multiplicado por 100.000 habitantes', 'Indica a ocorrência de internação por uso de drogas no âmbito do Sistema Único de Saúde. O uso de drogas é um importante fator relacionado à incidência do HIV, sendo que as internações podem indicar formas mais intensas de uso.  A taxa de internação por população pode indicar a maior prevalência do uso de drogas nos municípios.', 'Deficiência no registro da informação, por ser um sistema relacionado ao faturamento no âmbito do SUS.', 100, 'number', 'r', 'Intern transt mentais ', NULL), (63, 'var063', 'Escola_Prevencao', 'Programático ', 3, 'Percentual de escolas públicas no município que desenvolvem ações de prevenção às DST/aids, saúde sexual e reprodutiva, gravidez na adolescência e drogas (2006)', 'Ministério da Educação. Censo Escolar', 'Número de Escolas públicas de ensino fundamental e médio que desenvolvem ações de prevenção às DST/aids, saúde sexual e reprodutiva, gravidez na adolescência e drogas dividido pelo total de escolas públicas em 2006, multiplicado por 100 ', 'As ações de prevenção inseridas nas escolas são essenciais para promover práticas seguras entre adolescentes e jovens, estimular a realização do diagnóstico do HIV e das DST e facilitar o acesso aos insumos de prevenção.', '', 100, 'number', 'r', '% esc ações prev', NULL), (64, 'var064', 'Prop_0a3Consultas_PreNatal', 'Programático', 3, 'Percentual de mães que realizaram entre 0 a 3 consultas de pré-natal (2002-2005)', 'Fundação Seade. Sistema de Estatísticas Vitais.', 'Número de nascidos vivos de mães com até 3 consultas de pré-natal dividio pelo total de  nascidos vivos, entre 2002 e 2005, multiplicado por 100', 'Permite avaliar se a assistência pré-natal é precária na região em estudo, propiciando a vulnerabilidade à transmissão vertical de casos de aids.', '', 100, 'number', 'r', '%  0-3 cons pré-nat', NULL), (65, 'var065', 'Ind_Envelhecimento', 'Social', 5, 'Índice de envelhecimento (2004)', 'Fundação Seade.', 'Número de habitantes com 60 anos e mais dividido pelo número de habitantes com menos de 15 anos, em 2004, multiplicado por 100', 'Permite avaliar o processo de envelhecimento da população residente do município. Adota-se o corte etário da população idosa em 60 anos, de acordo com a Rede Interagencial de Informações para a Saúde - Ripsa e 25ª Conferência Sanitária Pan-Americana da Organização Pan-Americana da Saúde - Opas. Alguns países desenvolvidos adotam, todavia, 65 anos.', ' ', 100, 'number', 'r', 'Envelhec', NULL), (66, 'var066', 'RazaoSexo', 'Social', 5, 'Razão de sexos (2004)', 'Fundação Seade.', 'Número de homens dividido pelo número de mulheres, em 2004, multiplicado por 100', 'Permite avaliar o equilíbrio entre os sexos da população residente do município. Quanto mais próximo de 100, mais equilibrada está a distribuição por sexo', ' ', 100, 'number', 'r', 'Razão sexos', NULL), (67, 'var067', 'Tx_Cresc_Anual', 'Social', 5, 'Taxa de crescimento populacional (%) (2002-2005)', 'Fundação Seade.', 'Percentual de incremento médio anual da população residente, entre 2002 e 2005', 'Expressa em termos percentuais o crescimento médio da população em um determinado período de tempo. Indica o ritmo de crescimento populacional, que é influenciado pela dinâmica da natalidade, da mortalidade e das migrações.', 'A utilização da taxa em projeções populacionais para anos distantes do último censo demográfico pode não refletir alterações recentes da dinâmica demográfica, especialmente em populações pequenas.', 100, 'number', 'r', 'Cresc pop', NULL), (68, 'var068', 'TX_Fecundidade_15a19', 'Indivíduo', 2, 'Taxa específica de fecundidade de  15 a 19 anos, por 1.000 mulheres (2002-2005)', 'Fundação Seade. Sistema de Estatísticas Vitais.', 'Média de  nascidos vivos no período de 2002 a 2005, de mães residentes de 15 a 19 anos, dividido pela média da população feminina  na mesma faixa etária de de 2003 e 2004, multiplicado por 1.000', 'Indica o número médio de filhos das jovens de 15 a 19 anos residentes em determinada área. Mede a intensidade da fecundidade entre adolescentes. A gravidez precoce está associada com prática sexual desprotegida.', '', 100, 'number', 'r', 'Fecund', NULL), (69, 'var069', 'Tx_Mortalidade_ColoUtero', 'Indivíduo', 2, 'Taxa de mortalidade por câncer de colo de útero em mulheres de 15 anos ou mais, por 100.000 mulheres (2002-2005)', 'Fundação Seade. Sistema de Estatísticas Vitais.', 'Nº de óbitos por câncer de colo de útero de mulheres com 15 anos ou mais residentes, em 2002 a 2005, dividido  pela média da população na mesma faixa etária de 2003 e 2004, multiplicado por 100.000', ' As cepas oncogênicas 16, 18, 31, 33 e 45 do papiloma vírus estão intimamente relacionadas com a alta incidência de câncer de colo uterino (dados de literatura mostram que o HPV é encontrado em mais de 90% dos casos de câncer de colo de útero), bem como, a baixa imunidade no caso dos portadores de aids. A prática de sexo desprotegido aumenta a possibilidade de aquisição do HIV e  HPV. Quanto maior a mortalidade por câncer de colo uterino, maior prevalência do HPV e portanto maior possibilidade de infecção pelo HIV', 'A maior variabilidade nas taxas, em alguns municípios, pode decorrer do número reduzido de óbitos, ocorrido no período considerado.', 100, 'number', 'r', 'Mort CA colo útero', NULL), (70, 'var070', 'Grau_Urbanização', 'Social', 5, 'Grau de urbanização (%) (2004)', 'Fundação Seade.', 'Número de habitantes residentes em área urbana dividio pelo total de habitantes,em 2000, multiplicado por 100 ', 'Indica a proporção de população residente dentro dos limites urbanos dos municípios. Permite avaliar a situação da urbanização da população.', 'As categorias rural e urbana de uma unidade geográfica são, no Brasil, definidas por lei municipal. Os critérios para determinar se um domicílio fica na zona rural ou urbana são de ordem político-administrativas e variam, portanto, de um município a outro', 100, 'number', 'r', 'Urbanização', NULL), (71, 'var071', 'Anos_Estudo', 'Social', 5, 'Média de anos de estudos da população de 15 a 64 Anos (2000)', 'IBGE. Censo Demográfico', 'Soma dos anos de estudo concluídos de cada indivíduo da população de 15 a 64 anos dividido pela população de 15 a 64 anos,em 2000', 'O indicador contribui para análise de um dos fatores determinantes das condições de vida e de saúde da população.', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', 'Anos estud', NULL), (72, 'var072', 'Renda_per_Capita_2000 ', 'Social', 5, 'Renda familiar per capita (2000)', 'IBGE. Censo Demográfico', 'Razão entre a somatória da renda de todos os indivíduos da família e o número total desses indivíduos. A renda per capita familiar de cada indivíduo é definida como a razão entre a soma da renda de todos os membros da família e o número de membros da mesm', 'Indica a renda média das famílias. Permite verificar as condições de renda da população, fator que pode interferir nas condições de acesso a serviços de saúde.', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', 'Renda', NULL), (73, 'var073', 'PIB_per_Capita', 'Social', 5, 'PIB municipal per capita (2004)', 'IBGE; Fundação Seade.', 'Total dos bens e serviços produzidos pelas unidades produtoras no município, ou seja, a soma dos valores adicionados acrescida dos impostos, dividido pela população de 2004.', 'Indica o nível de produção econômica em um dado território em relação à sua população. Valores muito baixos indicam, em geral, a existência de segmentos populacionais com precárias condições de vida, sugerindo maior atenção para área social.', '', 100, 'number', 'r', 'PIB', NULL), (74, 'var074', 'TX_Particip_M', 'Social', 5, 'Taxa de participação dos homens no mercado de trabalho (2000)', 'IBGE. Censo Demográfico', 'Soma dos homens ocupados e desempregados com 10 anos ou mais dividido pelo total de homens com 10 anos ou mais,em 2000, multiplicado por 100', 'Indica a proporção da população masculina em idade ativa incorporada ao mercado de trabalho (como ocupada ou desempregada). As diferença de gênero na inserção de mulheres no mercado de trabalho pode determinar o acesso aos serviços e bens relacionados às condições de vida e à promoção à saúde, influindo no grau de vulnerabilidade das mulheres ao HIV e aids', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', 'Partic H merc trab', NULL), (75, 'var075', 'TX_Particip_F', 'Social', 5, 'Taxa de participação das mulheres no mercado de trabalho (2000)', 'IBGE. Censo Demográfico', 'Soma dos mulheres ocupadas e desempregadas com 10 anos ou mais dividido pelo total de mulheres com 10 anos ou mais, em 2000, multiplicado por 100', 'Indica a proporção da população feminina em idade ativa incorporada ao mercado de trabalho (como ocupada ou desempregada). As diferença de gênero na inserção de mulheres no mercado de trabalho pode determinar o acesso aos serviços e bens relacionados às condições de vida e à promoção à saúde, influindo no grau de vulnerabilidade das mulheres ao HIV e aids', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', 'Partic M merc trab', NULL), (76, 'var076', 'razao_particip', 'Social', 5, 'Razão entre as taxas de participação de homens e mulheres no mercado de trabalho (2000)', 'IBGE. Censo Demográfico', 'Taxa de Participação Masculina dividida pela Taxa de Participação Feminina,em 2000', 'Permite avaliar o equilibrio entre homens e de mulheres quanto à inserção no mercado de trabalho. Valores iguais a 1 indicam que as taxas de participação de homens e de mulheres se equivalem; acima de 1, há predominância de homens no mercado de trabalho e, abaixo, predominância de mulheres. As diferença de gênero na inserção de mulheres no mercado de trabalho pode determinar o acesso aos serviços e bens relacionados às condições de vida e à promoção á saúde, influindo no grau de vulnerabilidade das mulheres ao HIV e aids', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', 'H/M merc trab', NULL), (77, 'var077', 'Desp_Saude_0205 ', 'Social', 5, 'Despesa municipal com saúde por habitante (2002-2005)', 'Mnistério da Saúde. Sistema de Informações sobre Orçamento Público em Saúde - SIOPS', 'Total de despesas em saúde sob responsabilidade do município dividido pela população total', 'A Constituição brasileira prevê gastos mínimos com saúde a ser realizado pelos governos municipais. Maiores investimentos no setor saúde podem estar associados ao aprimoramento do sistema local de saúde e à melhora da resposta na prevenção de doenças e promoção de saúde.', 'Não há regulamentação da legislação que prevê o gasto em saúde e governos podem estar adotando critérios diferenciados para apropriação dos gastos em saúde.', 100, 'number', 'r', 'Desp mun', NULL), (78, 'var078', 'Part_Receita_Saude_0205 ', 'Social', 5, 'Percentual de comprometimento do orçamento municipal com saúde (2002-2005)', 'Mnistério da Saúde. Sistema de Informações sobre Orçamento Público em Saúde - SIOPS', 'Orçamento comprometido com a Saúde dividido pelo orçamento total do município, multiplicado por 100', 'A maior proporção de investimento em saúde demonstra a priorização do gestor municiapl com a saúde. Revela ainda o cumprimento da Constituição Nacional que prevê gastos mínimos com saúde e o limite municipal para aumentar os investimentos públicos com recursos próprios.', 'Não há regulamentação da legislação que prevê o gasto em saúde e governos podem estar adotando critérios diferenciados para apropriação dos gastos em saúde.', 100, 'number', 'r', '% orçam mun saúde ', NULL), (79, 'var079', 'Prop_Dom_Infra_Adeq', 'Social', 5, 'Percentual de domicílios com infra-estrutura interna urbana adequada (2000)', 'IBGE. Censo Demográfico; Fundação Seade.', 'Número de domicílios que dispõem de ligação às redes públicas de abastecimento (água e energia elétrica) e de coleta (lixo e esgoto), sendo a fossa séptica a única exceção aceita no lugar do esgoto, dividido pelo total de domicílios permanentes urbanos, e', 'O indicador contribui para análise de um dos fatores determinantes das condições de vida e de saúde da população, que refere-se às condições habitacionais adequadas ', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', '% dom infra-estr adeq', NULL), (80, 'var080', 'Prop_Dom_Espaço_Suf', 'Social', 5, 'Percentual de domicílios com espaço suficiente (2000)', 'IBGE. Censo Demográfico; Fundação Seade.', 'Número de domicílios com espaço suficiente dividido pelo total de domicílios em área urbana, em 2000, multiplicado por 100', 'Refere-se a proporção de domicílios com pelo menos quatro cômodos, sendo um deles banheiro ou sanitário. O indicador contribui para análise de um dos fatores determinantes das condições de vida e de saúde da população, que refere-se às condições habitacionais inadequadas. Este tipo de moradia é considerado de composição mínima, para execução das funções básicas a toda moradia.', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', '%dom espaço suf', NULL), (81, 'var081', 'Prop_Dom_Favela', 'Social', 5, 'Percentual de domicílios em favela (2000)', 'IBGE. Censo Demográfico; Fundação Seade.', 'Número de domicílios em favela dividido pelo total de domicílios em área urbana, em 2000, multiplicado por 100', 'O indicador contribui para análise de um dos fatores determinantes das condições de vida e de saúde da população, que refere-se às condições habitacionais inadequadas', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', '% dom favela', NULL), (82, 'var082', 'Tx_Medicos', 'Social', 5, 'Médicos em estabelecimentos de saúde vinculados ao SUS por 10.000 hab. (2003)', 'IBGE. Pesquisa de Assistência Médico-Sanitária.', 'Número de postos de trabalho médico em estabelecimentos de Saúde vinculados ao SUS dividido pela população total,em 2003, multiplicado por 10.000', 'Permite avaliar a disponibilidade de profissionais médicos vinculados ao SUS.', 'Os dados referem-se ao pessoal ocupado, portanto um mesmo profissional pode ser contado mais de uma vez.', 100, 'number', 'r', 'Médicos SUS', NULL), (83, 'var083', 'Tx_Uso_Entorp', 'Indivíduo', 2, 'Taxa de ocorrência de uso de entorpecentes, por 10.000 hab. (2002-2005)', 'Secretaria de Estado da Segurança Pública–SSP; Fundação Seade', 'Número  de ocorrências registradas de uso de entorpecentes (soma dos boletins de ocorrências policiais e termos circunstanciados), conforme definido pela legislação vigente, dividido pela média da população de 2003 e 2004, multiplicado por 10.000', 'A ocorrência maior do fenômeno pode estar relacionada a maior presença de usuários de drogas injetáveis (UDI) e maior dificuldade de acesso aos serviços de saúde para prevenção e assistência aos portadores HIV.', 'Não reflete a prevlência do uso de entorpecentes na população. É influenciado pela atuação dos órgãos de segurança pública e do judiciário.', 100, 'number', 'r', 'Ocor entorpec', NULL), (84, 'var084', 'IPVS2000_Nenhuma', 'Social', 5, 'Percentual da população pertencente ao grupo sem vulnerabilidade no IPVS (2000)', 'Fundação Seade', 'Número de habitantes em setores censitários classificados no Índice Paulista de Vulnerabilidade Social (IPVS) como sem vulnerabilidade dividido pelo total da população, multiplicado por 100', '', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', '% sem vulner IPVS', NULL), (85, 'var085', 'IPVS2000_MuitoBaixa', 'Social', 5, 'Percentual da população pertencente ao grupo com vulnerabilidade muito baixa no IPVS (2000)', 'Fundação Seade', 'Número de habitantes em setores censitários classificados no Índice Paulista de Vulnerabilidade Social (IPVS) como  vulnerabilidade muito baixa dividido pelo total da população, multiplicado por 100', '', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', '% vulner muito baixa IPVS', NULL), (86, 'var086', 'IPVS2000_Baixa', 'Social', 5, 'Percentual da população pertencente ao grupo com vulnerabilidade baixa no IPVS (2000)', 'Fundação Seade', 'Número de habitantes em setores censitários classificados no Índice Paulista de Vulnerabilidade Social (IPVS) como  vulnerabilidade baixa dividido pelo total da população, multiplicado por 100', '', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', '% vulner baixa IPVS', NULL), (87, 'var087', 'IPVS2000_Media', 'Social', 5, 'Percentual da população pertencente ao grupo com vulnerabilidade média no IPVS (2000)', 'Fundação Seade', 'Número de habitantes em setores censitários classificados no Índice Paulista de Vulnerabilidade Social (IPVS) como  vulnerabilidade média dividido pelo total da população, multiplicado por 100', '', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', '% vulner média  IPVS', NULL), (88, 'var088', 'IPVS2000_Alta', 'Social', 5, 'Percentual da população pertencente ao grupo com vulnerabilidade alta no Índice Paulista de Vulnerabilidade Social (IPVS) (2000)', 'Fundação Seade', 'Número de habitantes em setores censitários classificados no Índice Paulista de Vulnerabilidade Social (IPVS) como  vulnerabilidade alta dividido pelo total da população, multiplicado por 100', '', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', '% vulner alta IPVS', NULL), (89, 'var089', 'IPVS2000_MuitoAlta', 'Social', 5, 'Percentual da população pertencente ao grupo com vulnerabilidade muito alta no Índice Paulista de Vulnerabilidade Social (IPVS) (2000)', 'Fundação Seade', 'Número de habitantes em setores censitários classificados no Índice Paulista de Vulnerabilidade Social (IPVS) como  vulnerabilidade muito alta dividido pelo total da população, multiplicado por 100', '', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', '% vulner muito alta IPVS', NULL), (90, 'var090', 'iprs06', 'Social', 5, 'Grupo na classificação do IPRS (2006)', 'Fundação Seade', 'Grupo ao qual o Município pertence na classificação do Índice Paulista de Responsabilidade Social (IPRS) ', 'Os indicadores do IPRS sintetizam a situação de cada município no que diz respeito a riqueza, escolaridade e longevidade, e quando combinados geram uma tipologia que classifica os municípios  em cinco grupos:<br/>Grupo 1 - Municípios que se caracterizam por um nível elevado de riqueza com bons níveis nos indicadores sociais<br/>Grupo 2 - Municípios que, embora com níveis de riqueza elevados, não são capazes de atingir bons indicadores sociais<br/>Grupo 3 - Municípios com nível de riqueza baixo, mas com bons indicadores sociais<br/>Grupo 4 - Municípios que apresentam baixos níveis de riqueza e níveis intermediários de longevidade e/ou escolaridade<br/><br/>Grupo 5 - Municípios mais desfavorecidos do Estado, tanto em riqueza como nos indicadores sociais', '', 100, 'text', 'r', 'IPRS', NULL), (91, 'var091', 'IPRS_renda06', 'Social', 5, 'Valor do indicador de renda no  IPRS (2006)', 'Fundação Seade', 'Combinação linear de quatro variáveis, sendo expresso em uma escala de 0 a 100', 'Varia numa escala de 0 a 100, na qual 100 representa a melhor situação de riqueza  e zero, a pior.', '', 100, 'number', 'r', 'Renda IPRS', NULL), (92, 'var092', 'IPRS_longevidade06', 'Social', 5, 'Valor do indicador de longevidade no IPRS (2006)', 'Fundação Seade', 'Combinação linear de quatro taxas de mortalidade, sendo expresso em uma escala de 0 a 100,', 'Varia numa escala de 0 a 100, na qual 100 representa a melhor situação de longevidade e zero, a pior.', '', 100, 'number', 'r', 'Longev IPRS', NULL), (93, 'var093', 'IPRS_escolaridade06', 'Social', 5, 'Valor do indicador de escolaridade no IPRS (2006)', 'Fundação Seade', 'Combinação linear de quatro variáveis, sendo expresso em uma escala de 0 a 100', 'Varia numa escala de 0 a 100, na qual 100 representa a melhor situação de escolaridade e zero, a pior.', '', 100, 'number', 'r', 'Escolar IPRS', NULL), (94, 'var094', 'Gini_2000', 'Social', 5, 'Índice de Gini (2000)', 'IBGE. Censo Demográfico', 'Medida do grau de desigualdade existente na distribuição da rendada população,em 2000, expressa numa escala de 0 a 1.', 'Mede a desigualdade na distribuição de renda. Quanto mais próximo de 1, maior a concentração de renda.', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', 'Ind Gini', NULL), (95, 'var095', 'Rico_10_pobre40', 'Social', 5, 'Razão de renda entre os 10% mais ricos e os 40% mais pobres (2000)', 'IBGE. Censo Demográfico', 'Soma da renda dos 10% mais ricos, dividida pela soma da renda dos 40% mais pobres, em 2000', 'Indica  o número de vezes que a renda dos mais ricos é maior do que a renda dos mais pobres. Quanto mais elevados os valores, maior o desnível de renda entre grupos populacionais dos estratos considerados. Contribui para a análise da situação socioeconômica da população, identificando segmentos que requerem maior atenção de políticas públicas de saúde,  entre outras.', 'Dados por município disponíveis apenas em anos censitários.', 100, 'number', 'r', 'Razão renda', NULL), (96, 'var096', 'NCasos_02_05', 'Perfil da Epidemia', 4, 'Total de casos notificados de residentes (2002-2005)', 'Programa Estadual DST/Aids - SES/SP; Fundação Seade. BIPAids.', 'Soma dos casos notificados de residentes de 2002 a 2005. Consideram-se  os casos de residentes de 13 anos ou mais com ano de diagnóstico entre 2002 e 2005.', 'Indica a frequência de casos confirmados de aids, ou seja, a intensidade com que a doença acomete a população. A ocorrência de casos indica  presença de fatores favoráveis à transmissão da doença.', 'Há subnotificação de casos e/ou atraso no recebimento das notificações de aids. Ressalta-se que o dado não reflete a situação de infecção pelo HIV e sim a da doença, cujos sinais e sintomas surgem após um longo período de infecção assintomática.', 100, 'integer', 'r', 'Casos', NULL), (97, 'var097', 'NÓbitos_0205_Ouro', 'Perfil da Epidemia', 4, 'Total de óbitos por aids de residentes (2002-2005)', 'Programa Estadual DST/Aids - SES/SP; Fundação Seade. BIPAids.', 'Soma dos óbitos por Aids de residentes de 2002 a 2005. Consideram-se os óbitos de residentes de 13 anos ou mais com ano de diagnóstico entre 2002 e 2005.', 'Indica a frequência de óbitos por aids população.  Expressa as condições de diagnóstico e a qualidade da assistência médica dispensada, bem como o efeito das ações educativas e adoção de medidas de prevenção.', 'Subregistro de aids como causa de óbito. ', 100, 'integer', 'r', 'Óbitos', NULL), (98, 'var098', 'Pop_2010', 'Indivíduo', 2, 'População Total em 2010', 'IBGE. Censo Demográfico', 'População Total em 2010', '', '', 100, 'integer', 'r', 'População Total em 2010', NULL);



